app.debug = {};

app.debug.consoleStyle = function(severity) {
    var defaults = {
        background: "#ccc",
        padding: "0 5px",
        color: "#444",
        "font-weight": "bold",
        "font-size": "110%"
    }, styles = [];
    var mods = {
        info: "#D8FEFE",
        success: "#CCFECD",
        warning: "#FFFDD9",
        error: "#FFCECD"
    };
    if (style !== undefined) {
        defaults.background = mods[severity];
    }
    for (var prop in defaults) {
        styles.push(prop + ": " + defaults[prop]);
    }
    return styles.join("; ");
};

app.debug.log = function(msg, data, severity, caller) {
    if (severity === undefined) {
        severity = "error";
    }
    if (data === undefined) {
        data = "No data provided";
    }
    if (caller === undefined) {
        caller = arguments.callee.caller.toString();
    }
    if (typeof data[0] != "undefined" && data[0].error == "Internal server error") {} else {
        console.log('%c Bam! Error occurred in "' + caller + '": ' + msg, app.debug.consoleStyle(severity), data);
    }
};

app.debug.requestError = function(obj) {
    var caller = arguments.callee.caller.toString();
    app.debug.log("Ajax Request", obj, "error", caller);
};

app.request = {};

app.request.ajax = function(url) {
    var jsPromise = Promise.resolve($.ajax(url));
    return jsPromise;
};

app.template = {
    store: {}
};

app.template.preLoadedTemplates = [ "Shell", "NavMain" ];

app.template.loadTemplates = function(templateKeys, callback) {
    var deferreds = [];
    $.each(templateKeys, function(index, template) {
        deferreds.push($.get("tpl/" + template + ".html", function(data) {
            app.template.store[template] = data;
            if (app[template] && app[template].View) {
                app[template].View.prototype.template = Backbone.Marionette.TemplateCache.get(template);
            }
        }, "html"));
    });
    $.when.apply(null, deferreds).done(callback);
};

app.template.getTemplate = function(template, callback) {
    var req = app.request.ajax("tpl/" + template + ".html");
    req.then(callback, app.debug.requestError);
};

Backbone.Marionette.TemplateCache.prototype.loadTemplate = function(templateId) {
    return app.template.store[templateId];
};

